import axios from "axios";
import { useEffect, useState } from "react";
import Header from "./Header";
import SearchAccount from "./SearchAccount";
import SideBar from "./SideBar";

function Passbook(){
    const [trans,setTrans]=useState([])
    const [data,setData]=useState({
        "found":false,
        "accno":""
    })

    useEffect(()=>{
        console.log(data)
        axios.get("http://localhost:8090/api/accounts/passbook/"+data.accno)
        .then(resp=>{
            console.log(resp.data)    
            setTrans(resp.data.data)        
        })
        .catch(err=>{
            console.log(err)
        })
    },[data])

    return(
        <>
        <Header/>
        <div className="container-fluid">
            <div className="row">
                <div className="col-sm-2 bg-transparent p-0 border-right border-primary" style={{height:"calc(100vh - 80px)"}}>
                    <SideBar />
                </div>
                <div className="col-sm-10">
                    <h4 className="text-left p-2 border-bottom border-success">Cheque Book</h4>
                    <div className="card" style={{textAlign:"center"}}>
                        
                        <div className="card">
                            <div className="card-title"><hr/>CHEQUE BOOK<hr/><br/></div>
                            
                            <h6>Pay to the order of ___________________________</h6><br/>
                            amount $_______________________ only <br/><br/>
                            <h6 style={{paddingRight:"900px"}}>DATE: </h6><br/>
                            <h6 style={{paddingRight:"780px"}}>Signature: </h6>
                        </div>

                    </div>
                </div>
            </div>
        </div>
        </>
    )
}

export default Passbook;
